    false,nt"url": null,nt"notes": "The water quality buoys are part of the
    Pacific Islands Ocean Observing System (PacIOOS) and are designed to measure a variety
    of ocean parameters at fixed points. WQB-03 is located at Kiholo Bay along the leeward
    (Western) coast of the North Kona district of Big Island in Hawaii. Continuous sampling
    of this outflow area provides a record of baseline conditions of the chemical and
    biological environment for comparison when there are pollution events such as storm
    runoff or a sewage spill.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
